    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: "Este estudio necesita una ventana de incógnito/privada, y esta ventana no lo es. Puedes solucionarlo. Usando cualquier navegador excepto Safari, abre una ventana de incógnito y ejecuta el enlace del estudio en esa ventana.\n\nEXPLICACIÓN: Todos los principales navegadores te permiten abrir una ventana en modo incógnito, aunque el nombre varía, por ejemplo, “Incógnito”, “InPrivate”, “Navegación Privada” o “Ventana Privada”. Todos los navegadores excepto Safari informan si la página web está en modo incógnito. Safari siempre dice que no. El modo incógnito se utiliza típicamente para la privacidad. EasyEyes lo utiliza para facilitar el acceso a la biblioteca Firebase de EasyEyes, que es necesaria para la calibración del sonido.",
    su: "Loading...",
    sw: "Loading...",
    sv: "Loading...",
    tl: '"Kailangan ng pag-aaral na ito ng isang incognito/private na bintana, at hindi ito ang bintanang ito. Maaring ayusin mo ito. Gamit ang anumang browser maliban sa Safari, buksan ang isang incognito na bintana, at patakbuhin ang link ng pag-aaral sa bintanang iyon.\n\nPAGPAPALIWANAG: Pinapayagan ng lahat ng pangunahing browser na buksan ang isang bintana sa incognito mode, bagaman nag-iiba ang pangalan nito, halimbawa "Incognito", "InPrivate", "Private Browsing", o "Private Window". Lahat ng mga browser maliban sa Safari ay nag-uulat kung ang web page ay nasa incognito mode. Palaging sinasabi ng Safari na hindi. Karaniwang ginagamit ang incognito mode para sa privacy. Ginagamit ng EasyEyes ito upang mapadali ang access sa EasyEyes Firebase library, na kailangan para sa sound calibration."',
