    "en-UK": "Loading...",
    fi: "Loading...",
    fr: "Un identifiant unique est nécessaire pour lier les données entre les sessions. Cet ordinateur a déjà participé à une session le **ddd** avec l'identifiant EasyEyes “**sss**”. Appuyez sur OK si c'est vous. Sinon, si vous avez un fichier d'identifiant EasyEyes, appuyez sur le bouton de sélection de fichier ci-dessous pour l'ouvrir. (Le nom du fichier commence par \"EasyEyes\", se termine par \".txt\" et se trouve généralement dans votre dossier Téléchargements.) Si vous n'avez pas de fichier, mais connaissez votre identifiant EasyEyes, alors tapez-le. Sinon, créez simplement votre propre identifiant, qui peut être n'importe quelle chaîne alphanumérique d'au moins 5 caractères. Ça peut être votre nom, si vous voulez. Nous nous en souviendrons pour vous sur cet ordinateur, mais si vous allez sur un autre ordinateur, veuillez emporter votre fichier d'identifiant EasyEyes (le fichier le plus récent dans votre dossier Téléchargements), ou au moins noter votre identifiant EasyEyes. Utilisez-le à chaque fois pour lier vos données de session en session.",
    de: "Loading...",
    el: '"Απαιτείται ένα μοναδικό αναγνωριστικό για να συνδέσετε τα δεδομένα ανάμεσα σε συνεδρίες. Αυτός ο υπολογιστής συμμετείχε προηγουμένως σε μια συνεδρία στο **ddd** με το EasyEyes ID "**sss**". Πατήστε ΟΚ αν είστε εσείς. Διαφορετικά, αν έχετε ένα αρχείο EasyEyes ID, πατήστε το κουμπί επιλογής αρχείου παρακάτω για να το ανοίξετε. (Το όνομα αρχείου αρχίζει με "EasyEyes", τελειώνει με ".txt" και συνήθως βρίσκεται στον φάκελο Λήψεις σας.) Αν δεν έχετε ένα αρχείο, αλλά γνωρίζετε το EasyEyes ID σας, τότε πληκτρολογήστε το. Διαφορετικά, απλά δημιουργήστε το δικό σας αναγνωριστικό, το οποίο μπορεί να είναι οποιαδήποτε αλφαριθμητική σειρά τουλάχιστον 5 χαρακτήρων. Μπορεί να είναι το όνομά σας, αν θέλετε. Θα το θυμόμαστε για εσάς σε αυτόν τον υπολογιστή, αλλά αν πάτε σε έναν άλλο υπολογιστή, παρακαλούμε πάρτε το αρχείο EasyEyes ID σας (το πιο πρόσφατο αρχείο στον φάκελο Λήψεις σας), ή τουλάχιστον γράψτε κάτω το EasyEyes ID σας. Χρησιμοποιήστε το κάθε φορά για να συνδέσετε τα δεδομένα σας από συνεδρία σε συνεδρία."',
