    ru: "Для связи данных между сеансами требуется уникальный идентификатор. Этот компьютер ранее участвовал в сеансе на **ddd** с идентификатором EasyEyes «**sss**». Нажмите ОК, если это вы. В противном случае, если у вас есть файл с идентификатором EasyEyes, нажмите кнопку выбора файла ниже, чтобы открыть его. (Имя файла начинается с «EasyEyes», заканчивается на «.txt» и обычно находится в папке «Загрузки».) Если у вас нет файла, но вы знаете свой идентификатор EasyEyes, введите его. В противном случае, просто придумайте свой собственный идентификатор, который может быть любой буквенно-цифровой строкой длиной не менее 5 символов. Это может быть ваше имя, если хотите. Мы запомним его для вас на этом компьютере, но если вы перейдете на другой компьютер, возьмите свой файл с идентификатором EasyEyes (самый последний файл в папке «Загрузки») или хотя бы запишите свой идентификатор EasyEyes. Используйте его каждый раз, чтобы связать ваши данные между сеансами.",
    sr: "Loading...",
    es: 'Se necesita una identificación única para vincular datos a través de las sesiones. Este ordenador participó previamente en una sesión el **ddd** con la identificación de EasyEyes “**sss**”. Presiona OK si eres tú. De lo contrario, si tienes un archivo de identificación de EasyEyes, presiona el botón de selección de archivo a continuación para abrirlo. (El nombre del archivo comienza con "EasyEyes", termina con ".txt" y normalmente se encuentra en tu carpeta de Descargas.) Si no tienes un archivo, pero conoces tu identificación de EasyEyes, entonces ingrésala. De lo contrario, simplemente crea tu propia identificación, que puede ser cualquier cadena alfanumérica de al menos 5 caracteres de longitud. Puede ser tu nombre, si lo deseas. Nosotros la recordaremos por ti en este ordenador, pero si vas a otro ordenador, por favor lleva tu archivo de identificación de EasyEyes (el archivo más reciente en tu carpeta de Descargas), o al menos anota tu identificación de EasyEyes. Úsala cada vez para vincular tus datos de sesión a sesión.',
    su: "Loading...",
    sw: "Loading...",
    sv: "Loading...",
    tl: '"Kailangan ang isang natatanging ID upang i-link ang data sa iba\'t ibang sesyon. Ang computer na ito ay nakilahok na dati sa isang sesyon sa **ddd** na may EasyEyes ID na "sss". Pindutin ang OK kung ikaw iyon. Kung hindi, kung mayroon kang isang file ng EasyEyes ID, pindutin ang button ng pagpili ng file sa ibaba upang buksan ito. (Ang pangalan ng file ay nagsisimula sa "EasyEyes", nagtatapos sa ".txt", at karaniwang nasa iyong Downloads folder.) Kung wala kang file, ngunit alam mo ang iyong EasyEyes ID, i-type ito. Kung hindi, gumawa lamang ng iyong sariling ID, na maaaring anumang alphanumerikong string na hindi bababa sa 5 na character ang haba. Maaari itong maging iyong pangalan, kung gusto mo. Tandaan namin ito para sa iyo sa computer na ito, ngunit kung pupunta ka sa ibang computer, mangyaring dalhin ang iyong file ng EasyEyes ID (ang pinakabagong file sa iyong Downloads folder), o kahit isulat ang iyong EasyEyes ID. Gamitin ito sa bawat pagkakataon upang i-link ang iyong data mula sesyon hanggang sesyon."',
