    hr: "❌ NESPOJIVO. Oprosti. Slobodno isprobajte neki drugi preglednik, računalo ili bilo što drugo koje bi moglo biti kompatibilno. U suprotnom pritisnite CANCEL da vratite ovu studiju na Prolific.com.",
