    fr: "\n❌ INCOMPATIBLE. Désolé. Vous pouvez essayer un autre navigateur, un autre ordinateur, ou tout ce qui pourrait être compatible. Sinon, appuyez sur ANNULER pour renvoyer cette étude à Prolific.com.",
