    kn: "❌ ಹೊಂದಾಣಿಕೆಯಾಗುವುದಿಲ್ಲ. ಕ್ಷಮಿಸಿ. ಇನ್ನೊಂದು ಬ್ರೌಸರ್, ಅಥವಾ ಕಂಪ್ಯೂಟರ್ ಅಥವಾ ಯಾವುದಾದರೂ ಹೊಂದಾಣಿಕೆಯನ್ನು ಪ್ರಯತ್ನಿಸಲು ನಿಮಗೆ ಸ್ವಾಗತ. ಇಲ್ಲವಾದರೆ ಈ ಅಧ್ಯಯನವನ್ನು Prolific.com ಗೆ ಹಿಂತಿರುಗಿಸಲು CANCEL ಅನ್ನು ಒತ್ತಿರಿ.",
    ko: "❌ 호환되지 않습니다. 죄송합니다. 다른 브라우저나 컴퓨터 또는 호환 가능한 모든 것을 사용해 보세요. 그렇지 않으면 취소를 눌러 이 연구를 Prolific.com으로 되돌리세요.",
    lt: "❌ NESUDERINAMA. Atsiprašome. Galite bandyti kitą naršyklę, arba kompiuterį, arba ką nors, kas gali būti suderinama. Kitu atveju spustelėkite ATŠAUKTI, kad grįžtumėte į šį tyrimą Prolific.com svetainėje.",
    ms: "❌ TIDAK SESUAI. Maaf. Anda dapat mencoba menggunakan browser lain, atau komputer lain, atau apa pun yang mungkin sesuai. Jika tidak, tekan BATAL untuk kembali ke studi ini di Prolific.com.",
    ml: "❌ പൊരുത്തപ്പെടാത്തത്. ക്ഷമിക്കണം. മറ്റൊരു ബ്രൗസർ, അല്ലെങ്കിൽ കമ്പ്യൂട്ടർ, അല്ലെങ്കിൽ അനുയോജ്യമായ മറ്റെന്തെങ്കിലും പരീക്ഷിക്കാൻ നിങ്ങൾക്ക് സ്വാഗതം. അല്ലെങ്കിൽ ഈ പഠനം Prolific.com-ലേക്ക് തിരികെ നൽകാൻ CANCEL അമർത്തുക.",
    no: "❌ INKOMPATIBELT. Beklager. Du kan prøve en annen nettleser, eller datamaskin, eller hva som helst som kan være kompatibelt. Ellers trykk AVBRYT for å returnere denne studien til Prolific.com.",
    fa: "❌ ناسازگار. متاسف. می توانید مرورگر یا رایانه دیگری یا هر چیزی که ممکن است سازگار باشد را امتحان کنید. در غیر این صورت CANCEL را بزنید تا این مطالعه به Prolific.com برگردد.",
    pl: "❌ NIEKOMPATYBILNY. Przepraszam. Możesz wypróbować inną przeglądarkę, komputer lub cokolwiek innego, co może być kompatybilne. W przeciwnym razie naciśnij ANULUJ, aby zwrócić to badanie do Prolific.com.",
    pt: "❌INCOMPATÍVEL. Desculpe. Você pode tentar outro navegador, ou computador, ou qualquer outro que seja compatível. Caso contrário, clique em CANCELAR para devolver este estudo ao Prolific.com.",
    ro: "❌ INCOMPATIBIL. Îmi pare rău. Sunteți binevenit să încercați alt browser, sau computer sau orice ar putea fi compatibil. În caz contrar, apăsați CANCEL pentru a returna acest studiu la Prolific.com.",
