    ja: "「あなたの携帯電話。ブランドとモデルの詳細が必要です。設定またはオプションメニューに移動し、リストの一番下までスクロールして、'システム'、'電話について'、'デバイスについて'などをクリックしてください。モデル名と番号を下の対応するフィールドにコピーしてください。」",
    kn: "Loading...",
    ko: "당신의 휴대폰. 브랜드와 모델을 구체적으로 알려주셔야 합니다. 설정 또는 옵션 메뉴로 이동하여 목록의 맨 아래로 스크롤하고 '시스템', '휴대폰 정보', '기기 정보' 또는 유사한 항목을 클릭하세요. 모델 이름과 번호를 아래 해당 필드에 복사하세요.",
    lt: "JŪSŲ TELEFONAS. Mums reikia informacijos apie jo gamintoją ir modelį. Eikite į Nustatymai arba Parinktys meniu, slinkite į sąrašo apačią ir spustelėkite „Sistema“, „Apie telefoną“, „Apie įrenginį“ ar panašiai. Nukopijuokite modelio pavadinimą ir numerį į atitinkamus laukus žemiau.",
    ms: "TELEFON ANDA. Kami memerlukan butiran yang menentukan jenama dan modelnya. Pergi ke menu Tetapan atau Pilihan, gulir ke bahagian bawah senarai, dan klik 'Sistem', 'Mengenai telefon', 'Peranti mengenai' atau seumpamanya. Salin nama dan nombor model ke medan yang sepadan di bawah.",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "Loading...",
    pt: "Loading...",
    ro: "TELEFONUL TĂU. Avem nevoie de detalii care să specifice marca și modelul acestuia. Accesează meniul Setări sau Opțiuni, derulează până la sfârșitul listei și apasă pe 'Sistem', 'Despre telefon', 'Despre dispozitiv' sau similar. Copiază numele și numărul modelului în câmpurile corespunzătoare de mai jos.",
    ru: "Loading...",
    sr: "Loading...",
    es: "SU TELÉFONO. Necesitamos detalles que especifiquen su marca y modelo. Vaya al menú de Configuración o Opciones, desplácese hasta el final de la lista y haga clic en 'Sistema', 'Acerca del teléfono', 'Acerca del dispositivo' o similar. Copie el nombre y número del modelo en los campos correspondientes a continuación.",
    su: "Loading...",
    sw: "SIMU YAKO. Tunahitaji maelezo yanayoelezea chapa na mfano wake. Nenda kwenye menyu ya Mipangilio au Chaguo, piga skrini hadi chini ya orodha, na bonyeza 'Mfumo', 'Kuhusu simu', 'Kuhusu kifaa' au kitu kama hicho. Nakili jina na nambari ya mfano kwenye uga unaofanana chini.",
    sv: "DIN TELEFON. Vi behöver detaljer som specificerar dess varumärke och modell. Gå till Inställningar eller Alternativmenyn, bläddra till botten av listan och klicka på 'System', 'Om telefon', 'Om enhet' eller liknande. Kopiera modellnamn och nummer till motsvarande fält nedan.",
    tl: "Loading...",
    tr: "TELEFONUNUZ. Marka ve modelini belirten ayrıntılara ihtiyacımız var. Ayarlar veya Seçenekler menüsüne gidin, listedeki en alt kısmına kaydırın ve 'Sistem', 'Telefon Hakkında', 'Cihaz Hakkında' veya benzer bir seçeneği tıklayın. Model adını ve numarasını aşağıdaki ilgili alanlara kopyalayın.",
    ur: "Loading...",
