      "点击右上角的三条水平线以显示地址栏。点击地址栏中的圆形箭头图标 ⤾ 刷新页面。",
    "zh-HK":
      "點擊右上角的三條水平線以顯示網址列。點選網址列中的圓形箭頭圖示 ⤾ 刷新頁面。",
    hr: "Dodirnite tri vodoravne crte u gornjem desnom kutu da biste otkrili adresnu traku. Dodirnite ikonu kružne strelice ⤾ koja se nalazi u adresnoj traci za osvježavanje stranice.",
