    da: "Tryk på de tre vandrette linjer i øverste højre hjørne for at afsløre adresselinjen. Tryk på det cirkulære pilikon ⤾ i adresselinjen for at opdatere siden.",
    nl: "Tik op de drie horizontale lijnen in de rechterbovenhoek om de adresbalk te tonen. Tik op het cirkelvormige pijl-icoon ⤾ in de adresbalk om de pagina te vernieuwen.",
    "en-UK":
      "Tap the three horizontal lines in the top-right corner to reveal the address bar. Tap the circular arrow icon ⤾ located in the address bar to refresh the page.",
    fi: "Napauta kolmea vaakaviivaa oikeassa yläkulmassa paljastaaksesi osoitepalkin. Päivitä sivu napauttamalla pyöreää nuolikuvaketta ⤾ osoitepalkissa.",
    fr: "Appuyez sur les trois lignes horizontales dans le coin supérieur droit pour révéler la barre d'adresse. Appuyez sur l'icône de flèche circulaire ⤾ située dans la barre d'adresse pour rafraîchir la page.",
    de: "Tippen Sie auf die drei horizontalen Linien in der oberen rechten Ecke, um die Adressleiste anzuzeigen. Tippen Sie auf das kreisförmige Pfeilsymbol ⤾ in der Adressleiste, um die Seite zu aktualisieren.",
    el: "Πατήστε τις τρεις οριζόντιες γραμμές στην επάνω δεξιά γωνία για να εμφανιστεί η γραμμή διευθύνσεων. Πατήστε το εικονίδιο κυκλικού βέλους ⤾ που βρίσκεται στη γραμμή διευθύνσεων για να ανανεώσετε τη σελίδα.",
    he: "הקש על שלושת הקווים האופקיים בפינה השמאלית העליונה כדי לחשוף את שורת הכתובת. הקש על סמל החץ העגול ⤾ הממוקם בשורת הכתובת כדי לרענן את העמוד.",
    hi: "पता बार दिखाने के लिए ऊपरी दाएं कोने में तीन क्षैतिज रेखाओं पर टैप करें। पेज को रीफ्रेश करने के लिए एड्रेस बार में स्थित गोलाकार तीर आइकन ⤾ पर टैप करें।",
    hu: "Érintse meg a három vízszintes vonalat a jobb felső sarokban a címsáv megjelenítéséhez. Az oldal frissítéséhez érintse meg a kör alakú nyíl ikont ⤾ a címsorban.",
    is: "Bankaðu á þrjár láréttu línurnar efst í hægra horninu til að birta veffangastikuna. Pikkaðu á hringlaga örartáknið ⤾ staðsett á veffangastikunni til að endurnýja síðuna.",
    id: "Sentuh tiga garis horizontal di sudut kanan atas untuk mengungkap bilah alamat. Sentuh ikon panah melingkar ⤾ yang terletak di bilah alamat untuk menyegarkan halaman.",
    it: "Tocca le tre linee orizzontali nell'angolo in alto a destra per rivelare la barra degli indirizzi. Tocca l'icona a freccia circolare ⤾ situata nella barra degli indirizzi per aggiornare la pagina.",
    ja: "右上隅にある 3 本の水平線をタップして、アドレス バーを表示します。アドレス バーにある円形の矢印アイコン ⤾ をタップして、ページを更新します。",
    kn: "ಮೇಲಿನ-ಬಲಭಾಗದ ಮೂರು ಆಯತಾಕಾರದ ಗೊಂದುಗಳನ್ನು ತಟ್ಟಿದರೆ ವಿಳಾಸ ಬಾರ್ ಹೊರಹೊಮ್ಮುವುದು. ಪುಟವನ್ನು ರಿಫ್ರೆಶ್ ಮಾಡಲು ವಿಳಾಸ ಬಾರ್ ನಲ್ಲಿರುವ ವೃತ್ತಾಕಾರ ಬಾಣವನ್ನು ತಟ್ಟಿದರೆ.",
    ko: "주소 표시줄을 표시하려면 오른쪽 상단 모서리에 있는 세 개의 가로선을 탭하세요. 페이지를 새로 고치려면 주소 표시줄에 있는 원형 화살표 아이콘 ⤾을 탭하세요.",
    lt: "Bakstelėkite tris horizontalias linijas viršutiniame dešiniajame kampe, kad būtų parodyta adreso juosta. Norėdami atnaujinti puslapį, bakstelėkite apskritos rodyklės piktogramą ⤾, esančią adreso juostoje.",
    ms: "Ketuk tiga garis mendatar di sudut kanan atas untuk munculkan bilah alamat. Ketuk ikon panah melingkar ⤾ yang terletak di bilah alamat untuk menyegarkan halaman.",
    ml: "വിലാസ ബാർ വെളിപ്പെടുത്തുന്നതിന് മുകളിൽ വലത് കോണിലുള്ള മൂന്ന് തിരശ്ചീന വരകളിൽ ടാപ്പ് ചെയ്യുക. പേജ് പുതുക്കുന്നതിന് വിലാസ ബാറിൽ സ്ഥിതിചെയ്യുന്ന വൃത്താകൃതിയിലുള്ള അമ്പടയാള ഐക്കണിൽ ടാപ്പ് ചെയ്യുക.",
    no: "Trykk på de tre horisontale linjene i øverste høyre hjørne for å vise adressefeltet. Trykk på det sirkulære pilikonet ⤾ i adressefeltet for å oppdatere siden.",
    fa: "برای نمایش نوار آدرس، روی سه خط افقی در گوشه بالا و راست صفحه کلیک کنید. برای تازه‌سازی صفحه، روی آیکون پیکان دایره‌ای ⤾ در نوار آدرس کلیک کنید.",
    pl: "Kliknij trzy poziome linie w prawym górnym rogu, aby wyświetlić pasek adresu. Aby odświeżyć stronę, dotknij ikony okrągłej strzałki ⤾ znajdującej się na pasku adresu.",
    pt: "Toque nas três linhas horizontais no canto superior direito para revelar a barra de endereço. Toque no ícone de seta circular ⤾ localizado na barra de endereço para atualizar a página.",
    ro: "Atingeți cele trei linii orizontale din colțul din dreapta sus pentru a dezvălui bara de adrese. Atingeți pictograma săgeată circulară ⤾ situată în bara de adrese pentru a reîmprospăta pagina.",
    ru: "Нажмите на три горизонтальные линии в правом верхнем углу, чтобы открыть адресную строку. Нажмите на иконку круглой стрелки ⤾, расположенную в адресной строке, чтобы обновить страницу.",
    sr: "Додирните три хоризонталне линије у горњем десном углу да бисте открили траку за адресу. Додирните икону кружне стрелице ⤾ која се налази у адресној траци да бисте освежили страницу.",
    es: "Toca las tres líneas horizontales en la esquina superior derecha para revelar la barra de direcciones. Toca el icono de flecha circular ⤾ ubicado en la barra de direcciones para actualizar la página.",
    su: "Tekan tilu garis horisontal di sudut kanan pangrupa pikeun ngabuka batang alamat. Tekan ikon panah lingkaran ⤾ anu aya di batang alamat pikeun ngaréfresh kaca.",
    sw: "Gusa mistari mitatu ya mlalo iliyo kwenye kona ya juu kulia ili kuonyesha upau wa anwani. Gonga aikoni ya mshale wa mviringo ⤾ iliyoko kwenye upau wa anwani ili kuonyesha upya ukurasa.",
    sv: "Tryck på de tre horisontella linjerna i det övre högra hörnet för att visa adressfältet. Tryck på den cirkulära pilikonen ⤾ som finns i adressfältet för att uppdatera sidan.",
    tl: "I-tap ang tatlong pahalang na linya sa kanang sulok sa itaas para ipakita ang address bar. I-tap ang circular arrow icon ⤾ na matatagpuan sa address bar para i-refresh ang page.",
    tr: "Adres çubuğunu ortaya çıkarmak için sağ üst köşedeki üç yatay çizgiye dokunun. Sayfayı yenilemek için adres çubuğunda bulunan dairesel ok simgesine ⤾ dokunun.",
    ur: "ایڈریس بار کو ظاہر کرنے کے لیے اوپری دائیں کونے میں تین افقی لائنوں کو تھپتھپائیں۔ صفحہ کو ریفریش کرنے کے لیے ایڈریس بار میں موجود سرکلر ایرو آئیکن ⤾ پر ٹیپ کریں۔",
