    es: "Este estudio necesita usar la cámara web. Otorgar acceso a tu cámara web es opcional, pero no podemos continuar sin ella. Si dijiste No por error y ahora deseas darnos acceso a tu cámara, por favor busca el ícono de la cámara en la barra de direcciones, haz clic en él, permite el acceso a la cámara y actualiza la página.",
    su: "Tämä tutkimus tarvitsee käyttää web-kameraa. Kameran käyttöoikeuden myöntäminen on vapaaehtoista, mutta emme voi jatkaa ilman sitä. Jos sanoit ei vahingossa ja haluat nyt antaa meille pääsyn kameraasi, löydä kamera-kuvake osoitepalkista, napsauta sitä, salli kameran käyttö ja päivitä sivu.",
