    hu: "Loading...",
    is: "Rannsóknin skoðar snjallsíma og tölvur. Niðurstöður rannsóknarinnar munu hjálpa til við að skipuleggja safn af prófílum fyrir hljóðnema snjallsíma og hátalara tölvu til að möguleggja netrannsóknir á heyrn. Kerfið byggist á því að tengja hljóðnemann snjallsíms notandans við kalibrerðan hljóðnema í rannsóknarstofu. Hver týpa hefur mismunandi hljóðnema, því er nauðsynlegt að tilgreina týpuna. Í þessari rannsókn er einungis geymd listi yfir snjallsíma og tölvumódel, án persónukenndra upplýsinga.",
    id: "Loading...",
    it: "Partecipare a questo studio ti permette di contribuire significativamente all'avanzamento della ricerca sull'udito online fornendo dati essenziali sulla varietà di microfoni per smartphone e altoparlanti per computer. Questa ricerca mira a creare una dettagliata biblioteca di profili di dispositivi che migliorerà l'accuratezza dei test dell'udito condotti online. Il programma dipende dall'abbinamento del microfono del telefono dell'utente con un microfono calibrato in laboratorio. Ogni modello ha un microfono diverso, quindi è cruciale specificare il modello.\n\nComprendendo che la privacy è una priorità, si prega di essere certi che questo sondaggio conserva solo i numeri di modello di telefoni e computer. Questi numeri di modello non sono collegati a nessuna informazione personale e non possono essere utilizzati per identificarti individualmente.",
