    hi: "भाग लेने के लिए, अपने फ़ोन के कैमरे को नीचे दिए गए QR कोड पर इंगित करें, और अपने फ़ोन के डिस्प्ले पर दिखाई देने वाले लिंक पर टैप करें।",
    hu: "RÉSZVÉTELHEZ irányítsa a telefon kameráját az alábbi QR-kódra, majd koppintson a telefon kijelzőjén megjelenő linkre.",
