    id: "UNTUK BERPARTISIPASI, arahkan kamera ponsel Anda ke kode QR di bawah, dan ketuk tautan yang muncul di layar ponsel Anda.",
    it: "PER PARTECIPARE, punta la fotocamera del tuo telefono sul codice QR qui sotto e tocca il link che appare sul display del tuo telefono.",
