    kn: "ಪಾಲ್ಗೊಳ್ಳಲು, ನಿಮ್ಮ ಫೋನ್ ಕ್ಯಾಮೆರಾವನ್ನು ಕೆಳಗಿನ QR ಕೋಡ್ ಗೆ ನೇರವಾಗಿ ನೇರಿಸಿ, ಮತ್ತು ನಿಮ್ಮ ಫೋನ್ ಪ್ರದರ್ಶನದಲ್ಲಿ ಕಾಣಿಸುವ ಲಿಂಕ್ ಅನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ.",
    ko: "참여하려면 휴대폰 카메라를 아래 QR 코드에 대고 휴대폰 디스플레이에 나타나는 링크를 탭하세요.",
    lt: "KAD DALYVAUTI, nukreipkite savo telefono kamerą į žemiau esantį QR kodą ir paspauskite nuorodą, kuri atsiras jūsų telefono ekrane.",
    ms: "UNTUK MENYERTAI, tunjukkan kamera telefon anda ke kod QR di bawah, dan ketik pautan yang muncul di paparan telefon anda.",
    ml: "പങ്കെടുക്കാൻ, നിങ്ങളുടെ ഫോണിൻ്റെ ക്യാമറ താഴെയുള്ള QR കോഡിലേക്ക് ചൂണ്ടി, നിങ്ങളുടെ ഫോണിൻ്റെ ഡിസ്പ്ലേയിൽ ദൃശ്യമാകുന്ന ലിങ്കിൽ ടാപ്പ് ചെയ്യുക.",
    no: "For å delta, pek telefonens kamera mot QR-koden nedenfor og trykk på lenken som vises på telefonens skjerm.",
    fa: "برای شرکت کردن، دوربین تلفن همراه خود را به کد QR زیر بگیرید و روی لینکی که در نمایشگر تلفن شما ظاهر می شود ضربه بزنید.",
    pl: "ABY UCZESTNICZYĆ, skieruj aparat swojego telefonu na poniższy kod QR i kliknij link, który pojawi się na wyświetlaczu Twojego telefonu.",
    pt: "PARA PARTICIPAR, aponte a câmera do seu telefone para o código QR abaixo e toque no link que aparece na tela do seu telefone.",
    ro: "PENTRU A PARTICIPA, îndreptați camera telefonului spre codul QR de mai jos și apăsați pe link-ul care apare pe ecranul telefonului.",
    ru: "ЧТОБЫ УЧАСТВОВАТЬ, наведите камеру своего телефона на QR-код ниже и нажмите на появляющуюся ссылку на экране вашего телефона.",
    sr: "DA BI STE UČESTVOVALI, usmerite kameru svog telefona ka QR kodu ispod i dodirnite link koji se pojavi na ekranu vašeg telefona.",
    es: "PARA PARTICIPAR, apunta la cámara de tu teléfono hacia el código QR que aparece abajo, y toca el enlace que aparece en la pantalla de tu teléfono.",
    su: "Pikeun milu, arahkeun kaméra telepon anjeun ka kode QR di handap, teras ketok tautan anu muncul dina tampilan telepon anjeun.",
    sw: "ILI KUSHIRIKI, elekeza kamera ya simu yako kwenye msimbo wa QR ulio hapa chini, na uguse kiungo kinachoonekana kwenye skrini ya simu yako.",
    sv: "FÖR ATT DELTA, rikta telefonens kamera mot QR-koden nedan och tryck på länken som visas på telefonens display.",
    tl: "UPANG MAKILAHOK, ituro ang kamera ng iyong telepono sa QR code sa ibaba, at tapikin ang link na lumalabas sa display ng iyong telepono.",
    tr: "KATILMAK İÇİN telefonunuzun kamerasını aşağıdaki QR koduna doğrultun ve telefonunuzun ekranında görünen bağlantıya dokunun.",
    ur: "حصہ لینے کے لیے، اپنے فون کے کیمرہ کو نیچے دیئے گئے QR کوڈ پر رکھیں، اور آپ کے فون کے ڈسپلے میں ظاہر ہونے والے لنک کو تھپتھپائیں۔",
