    hi: "क्षमा करें, QR कोड प्रदर्शित होने में विफल रहा। एक और प्रयास के लिए पृष्ठ को ताज़ा करें ↻। यदि समस्या बनी रहती है, तो नीचे QR कोड के माध्यम से कनेक्ट नहीं हो सकता बटन दबाएँ।",
    hu: "Sajnáljuk, a QR-kód nem jelent meg. Frissítse ↻ az oldalt egy újabb próbálkozáshoz. Ha a probléma továbbra is fennáll, nyomja meg a NEM LEHET KAPCSOLATOT A QR-KÓDON KÍVÜL gombot alább.",
    is: "Því miður, QR-kóði birtist ekki. Endurnýjaðu ↻ síðuna fyrir aðra tilraun. Ef vandamálið er viðvarandi skaltu ýta á CAN'T CONNECT VIA QR CODE hnappinn hér að neðan.",
