    ko: "죄송합니다. QR 코드를 표시하지 못했습니다. 다시 시도하려면 페이지를 새로고침 ↻하세요. 문제가 지속되면 아래 QR 코드를 통해 연결할 수 없음 버튼을 누르세요.",
