    ml: "ക്ഷമിക്കണം, QR കോഡ് ദൃശ്യമാകുന്നതിൽ പരാജയപ്പെട്ടു. മറ്റൊരു ശ്രമത്തിനായി പേജ് ↻ പുതുക്കുക. പ്രശ്നം നിലനിൽക്കുകയാണെങ്കിൽ, താഴെയുള്ള QR CODE വഴി ബന്ധിപ്പിക്കാൻ കഴിയില്ല ബട്ടൺ അമർത്തുക.",
    no: "Beklager, QR-koden ble ikke vist. Oppdater ↻ siden for et nytt forsøk. Hvis problemet vedvarer, trykk på KAN IKKE KOBLE TIL VIA QR-KODE nedenfor.",
