    sw: "Samahani, msimbo wa QR umeshindwa kuonekana. Onyesha upya ↻ ukurasa kwa jaribio lingine. Tatizo likiendelea, bonyeza kitufe cha CAN'T CONNECT KUPITIA MSIMBO WA QR hapa chini.",
    sv: "Tyvärr, QR-koden visades inte. Uppdatera ↻ sidan för ett nytt försök. Om problemet kvarstår, tryck på knappen KAN INTE ANSLUTA VIA QR-KOD nedan.",
    tl: "Paumanhin, nabigong lumitaw ang QR code. I-refresh ↻ ang pahina para sa isa pang pagsubok. Kung magpapatuloy ang problema, pindutin ang CAN'T CONNECT VIA QR CODE button sa ibaba.",
    tr: "Üzgünüz, QR kodu görüntülenemedi. Başka bir deneme için sayfayı yenileyin ↻. Sorun devam ederse aşağıdaki QR KODU İLE BAĞLANAMIYOR butonuna basın.",
