    hy: "Եթե ունեք սմարթֆոն, ուղարկեք ձեր ֆոնի կամերային թվային կամերային կոդին (սեւ և սպիտակ ստորեր), և սեղմեք այն ձեր ֆոնի էկրանի վրա։",
    bg: "Ако имате смартфон, насочете камерата на телефона си към следния QR код (черно-бели квадратчета) и кликнете върху него на екрана на телефона си.",
    "zh-CN":
      "如果您有智能手机，请将手机摄像头对准以下二维码（黑白格），然后在手机屏幕上单击它。",
    "zh-HK":
      "如果您有智慧型手機，請將手機相機對準以下二維碼（黑白格），然後在手機螢幕上點擊它。",
    hr: "Ako imate pametni telefon, usmjerite kameru telefona prema sljedećem QR kodu (crno-bijele kvačice) i kliknite na njega na zaslonu telefona.",
    cs: "Pokud máte smartphone, nasměrujte fotoaparát vašeho telefonu na následující QR kód (černobílé kontrolní pole) a klikněte na něj na obrazovce vašeho telefonu.",
    da: "Hvis du har en smartphone, skal du pege din telefonkamera på følgende QR-kode (sort og hvid tern), og klikke på den på din telefonskærm.",
    nl: "Als je een smartphone hebt, richt dan je telefooncamera op de volgende QR-code (zwart-wit blokjes) en klik erop op het scherm van je telefoon.",
    "en-UK":
      "If you have a smartphone, point your phone camera at the following QR code (black and white checks), and click on it in your phone's screen.",
    fi: "Jos sinulla on älypuhelin, osoita puhelimen kamera seuraavaan QR-koodiin (mustavalkoiset ruudut) ja napsauta sitä puhelimesi näytöllä.",
    fr: "Si vous avez un smartphone, pointez l'appareil photo de votre téléphone vers le code QR suivant (carrés noirs et blancs), et cliquez dessus sur l'écran de votre téléphone.",
    de: "Wenn Sie ein Smartphone besitzen, richten Sie die Kamera Ihres Telefons auf den folgenden QR-Code (schwarz-weiße Karos) und klicken Sie auf dem Bildschirm Ihres Telefons darauf.",
    el: "Εάν έχετε smartphone, στρέψτε την κάμερα του τηλεφώνου σας στον ακόλουθο κωδικό QR (ασπρόμαυροι έλεγχοι) και κάντε κλικ σε αυτόν στην οθόνη του τηλεφώνου σας.",
    he: "אם יש לך סמארטפון, כוון את מצלמת הטלפון שלך אל קוד ה-QR הבא (המחאות השחור-לבן), ולחץ עליו במסך הטלפון שלך.",
    hi: "यदि आपके पास स्मार्टफोन है, तो अपने फोन के कैमरे को निम्नलिखित क्यूआर कोड (काले और सफेद चेक) पर इंगित करें, और अपने फोन की स्क्रीन पर उस पर क्लिक करें।",
    hu: "Ha okostelefonja van, irányítsa a telefon kameráját a következő QR-kódra (fekete-fehér pipa), és kattintson rá a telefon képernyőjén.",
    is: "Ef þú ert með snjallsíma skaltu beina myndavél símans að eftirfarandi QR kóða (svart og hvítt hak) og smella á hann á skjá símans.",
    id: "Jika Anda memiliki ponsel cerdas, arahkan kamera ponsel Anda ke kode QR berikut (centang hitam putih), dan klik kode tersebut di layar ponsel Anda.",
    it: "Se hai uno smartphone, punta la fotocamera del telefono sul seguente codice QR (quadratini bianchi e neri) e cliccaci sopra dallo schermo del tuo telefono.",
    ja: "スマートフォンをお持ちの場合は、次の QR コード (黒と白のチェック) に携帯電話のカメラを向けて、携帯電話の画面でそれをクリックしてください。",
    kn: "ನಿಮ್ಮದು ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಇದ್ದರೆ, ನಿಮ್ಮ ಫೋನ್ ಕ್ಯಾಮೆರಾವನ್ನು ಕೆಳಗಿನ ಕ್ಯೂಆರ್ ಕೋಡ್ (ಕಪ್ಪು ಮತ್ತು ಬಿಳಿ ಚೆಕ್ಸ್) ಗೆ ನೇರವಾಗಿ ನೇರವಾಗಿ ನೋಡಿ, ಮತ್ತು ನಿಮ್ಮ ಫೋನ್ ಸ್ಕ್ರೀನ್‌ನಲ್ಲಿ ಅದನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.",
    ko: "스마트폰이 있는 경우 휴대폰 카메라로 다음 QR 코드(흑백 체크)를 가리키고 휴대폰 화면에서 해당 코드를 클릭하세요.",
    lt: "Jei turite išmanųjį telefoną, nukreipkite telefono kamerą į toliau pateiktą QR kodą (juodai baltas varneles) ir spustelėkite jį telefono ekrane.",
    ms: "Jika anda mempunyai telefon pintar, halakan kamera telefon anda pada kod QR berikut (semakan hitam dan putih), dan klik padanya dalam skrin telefon anda.",
    ml: "നിങ്ങൾക്ക് ഒരു സ്‌മാർട്ട്‌ഫോൺ ഉണ്ടെങ്കിൽ, ഇനിപ്പറയുന്ന QR കോഡിലേക്ക് നിങ്ങളുടെ ഫോൺ ക്യാമറ പോയിൻ്റ് ചെയ്യുക (കറുപ്പും വെളുപ്പും പരിശോധനകൾ), നിങ്ങളുടെ ഫോണിൻ്റെ സ്‌ക്രീനിൽ അതിൽ ക്ലിക്കുചെയ്യുക.",
