    it: '\n0. EVITA LA SOSPENSIONE. Il telefono non deve andare in modalità sospensione durante la calibrazione. Se la batteria è scarica, collegarlo alla corrente. Se necessario: aumentare il tempo prima della sospensione ad almeno 5 minuti. Su iPhone vai su Impostazioni: Schermo e luminosità: Blocco automatico. Su Android vai su Impostazioni: Schermo: Timeout dello schermo.\n1. EVITA INTERRUZIONI. Se possibile, disabilita gli avvisi. Se la calibrazione viene interrotta, ad esempio da una chiamata in arrivo, premi il pulsante "Ri-registra" per iniziare di nuovo.\n2. CONCEDI IL PERMESSO. Se appare un pop-up che chiede il permesso di usare il microfono, clicca su "Consenti".\n3. APPOGGIA IL TELEFONO SU UN BICCHIERE ALTO (o una tazza da caffè o una lattina di soda/birra), tra te e la tua tastiera, con il bordo del microfono (inferiore) rivolto verso il tuo computer. Gli altoparlanti del laptop si trovano nella tastiera; posiziona il tuo telefono in modo che il suo microfono sia sulla tua linea visiva verso la tastiera. Gli altoparlanti del desktop sono dietro una griglia; orienta il tuo telefono verso la griglia.\n4. PROCEDI. Premi "Procedi".\n',
    ja: '0. 眠りを防止する。キャリブレーション中は電話がスリープしないようにする必要があります。バッテリーが低い場合は充電してください。必要に応じて、スリープ時間を少なくとも5分に設定してください。iPhoneの場合は、設定→ディスプレイ→輝度→自動ロックに移動します。Androidの場合は、設定→ディスプレイ→スクリーンタイムアウトに移動します。\n1. 中断を避ける。可能な場合は、アラートを無効にしてください。キャリブレーションが中断された場合、例えば着信電話によって、"再録音"ボタンを押して再度開始してください。\n2. 許可を与える。ポップアップがマイクの使用許可を求める場合は、「許可」をクリックしてください。\n3. 高い飲み物のグラス（またはコーヒーカップまたはソーダ/ビール缶）に電話を置き、キーボードとの間に、マイク（下部）のエッジがコンピューターに向かっているようにしてください。ラップトップのスピーカーはキーボードにあります。電話を配置する際には、そのマイクがキーボードへの視線上にあるようにしてください。デスクトップのスピーカーはグリルの後ろにあります。電話をグリルに向けてください。\n4. 進める。"進める"ボタンを押してください。\n',
    kn: '"0. ನಿದ್ರೆಯನ್ನು ತಡೆಯಿರಿ. ಕ್ಯಾಲಿಬ್ರೇಶನ್ ಮುಂದುವರಿಸುವಾಗ ಫೋನ್ ನಿದ್ರೆಗೆ ಹೋಗಬಾರದು. ಬ್ಯಾಟರಿ ಕಡಿಮೆಯಾದರೆ, ಅದನ್ನು ಪ್ಲಗ್ ಇನ್ ಮಾಡಿ. ಅಗತ್ಯವಾದಾಗ: ನಿದ್ರೆಗೆ ಸಮಯವನ್ನು ಕಡಿಮೆಗೆ ಕಡಿಮೆ 5 ನಿಮಿಷಕ್ಕೆ ಹೆಚ್ಚಿಸಿ. ಐಫೋನ್ನಲ್ಲಿ ಸೆಟ್ಟಿಂಗ್ಗೆ ಹೋಗಿ: ಡಿಸ್ಪ್ಲೇ: ಬ್ರೈಟ್ನೆಸ್: ಆಟೋಲಾಕ್. ಆಂಡ್ರಾಯ್ಡ್ ಸೆಟ್ಟಿಂಗ್ಗೆ ಹೋಗಿ: ಡಿಸ್ಪ್ಲೇ: ಸ್ಕ್ರೀನ್ ಟೈಮ್ ಔಟ್.\n1. ಅಡ್ಡಿಯಾಗಿರಿ. ಸಾಧ್ಯವಾದರೆ, ಅಲರ್ಟ್ ಅನುಮತಿಸದೆ ಇರಿ. ಕ್ಯಾಲಿಬ್ರೇಶನ್ ಅಡಚಣೆಗೆ ಒಳಗಾದರೆ, ಉದಾಹರಣೆಗೆ ಫೋನ್ ಕಾಲ್ ಬಂದಾಗ, "ರೀ-ರೆಕಾರ್ಡ್" ಬಟನ್ ಒತ್ತಿ ಮತ್ತೆ ಪ್ರಾರಂಭಿಸಿ.\n2. ಅನುಮತಿ ನೀಡಿ. ಪಾಪ್ ಅಪ್ ಮೈಕ್ರೊಫೋನ್ ಬಳಸಲು ಅನುಮತಿ ಕೇಳಿದರೆ, "ಅನುಮತಿ" ಕ್ಲಿಕ್ ಮಾಡಿ.\n3. ಒಂದು ಉನ್ನತ ಕುಡಿಯುವ ಗ್ಲಾಸ್ (ಅಥವಾ ಕಾಫಿ ಮಗ್ ಅಥವಾ ಸೋಡಾ / ಬೀರ್ ಕೆನ್), ನೀವು ಮತ್ತು ಕೀಬೋರ್ಡ್ ನ ನಡುವೆ ಮೈಕ್ರೊಫೋನ್ (ಕೆಳಗೆ) ಎಡ್ಜ್ ಕಂಡುಕೊಳ್ಳುವಂತೆ ಫೋನ್ ಮೇಲೆ ಇಟ್ಟುಕೊಳ್ಳಿ. ಲ್ಯಾಪ್ಟಾಪ್ ಸ್ಪೀಕರ್ಸ್ ಕೀಬೋರ್ಡ್ ನಲ್ಲಿವೆ; ಫೋನ್ ಮೈಕ್ರೊಫೋನ್ ಕೀಬೋರ್ಡ್ ಗೆ ನೀವು ನೋಡುವ ರೇಖೆಯ ಮೇಲೆ ಇರುವಂತೆ ಇಟ್ಟುಕೊಳ್ಳಿ. ಡೆಸ್ಕ್ಟಾಪ್ ಸ್ಪೀಕರ್ಸ್ ಗ್ರಿಲ್ ಹಿಂದೆ ಇವೆ; ಫೋನ್ ಗ್ರಿಲ್ ಗೆ ನಿಮ್ಮ ಫೋನ್ ತೋರಿಸಿ.\n4. ಮುಂದುವರಿಸಿ. "ಮುಂದುವರಿಸಿ" ಒತ್ತಿರಿ."',
    ko: '0. 수면 방지. 보정 중에는 전화기가 절대로 슬립 모드로 들어가지 않아야 합니다. 배터리가 부족한 경우 충전하세요. 필요한 경우, 슬립 시간을 최소 5분으로 늘리세요. 아이폰의 경우 설정으로 이동하여 디스플레이, 밝기, 자동 잠금을 선택하세요. 안드로이드의 경우 설정으로 이동하여 디스플레이, 화면 시간 제한을 선택하세요.\n1. 중단 피하기. 가능하다면 알림을 비활성화하세요. 보정이 중단되는 경우, 예를 들어 전화가 오는 경우, "다시 녹음" 버튼을 눌러 다시 시작하세요.\n2. 권한 부여. 팝업 창에서 마이크 사용 권한을 요청하면 "허용"을 클릭하세요.\n3. 긴 음료용 유리잔(또는 커피 머그잔 또는 소다/맥주 캔) 위에 전화기를 올려두세요. 키보드와 당신 사이에 두고, 마이크(하단) 부분이 컴퓨터를 향하도록 하세요. 노트북 스피커는 키보드에 있으며, 전화기를 키보드를 향해 놓으세요. 데스크톱 스피커는 그릴 뒤에 있으므로 전화기를 그릴을 향하도록 하세요.\n4. 진행하세요. "진행"을 누르세요.\n',
    lt: '0. NELEISTI MIEGOTI. Telefonas neturi miegoti kalibravimo metu. Jei baterija yra išsikrovusi, prijunkite jį į įkroviklį. Jei reikia: Padidinkite miego laiką bent iki 5 minučių. IPhone\'e eikite į Nustatymai: Ekranas: Ryškumas: Automatinis užrakinimas. Android\'e eikite į Nustatymai: Ekranas: Ekranas išjungiamas.\n1. VENGTI PERTRAUKŲ. Jei įmanoma, išjunkite pranešimus. Jei kalibravimas bus pertrauktas, pvz., įeinančiu skambučiu, paspauskite mygtuką "Perkurti" ir pradėkite iš naujo.\n2. SUTEIKTI LEIDIMĄ. Jei iššoka pranešimas, prašantis leidimo naudoti mikrofoną, spustelėkite "Leisti".\n3. PADĖKITE TELEFONĄ ANT AUKŠTO STIKLINIO INDĖLIO (ar kavos puodelio ar gazuoto gėrimo skardinės), tarp jūsų ir klaviatūros, su mikrofono (apačios) kraštu nukreiptu į kompiuterį. Nešiojamųjų kompiuterių garsiakalbiai yra klaviatūroje; padėkite telefoną taip, kad jo mikrofonas būtų matomas iš jūsų linijos į klaviatūrą. Stacionariųjų kompiuterių garsiakalbiai yra už grotelių; nukreipkite telefoną į grotelės pusę.\n4. TĘSTI. Paspauskite "Tęsti".',
    ms: "Loading...",
