    fr: "Nous allons mesurer la taille de cet écran. Utilisez le menu déroulant pour choisir quelque chose de pratique. Vous pouvez utiliser n'importe quel connecteur USB courant (y compris celui qui alimente votre ordinateur) ou une carte de crédit (ou toute carte de même taille). Placez votre objet sur l'écran et déplacez le curseur pour ajuster l'image afin qu'elle corresponde à la taille de votre objet. Lorsqu'ils correspondent, appuyez sur RETOUR (ou cliquez sur OK) pour continuer.",
