    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Meg fogjuk mérni ennek a képernyőnek a méretét. Használd a legördülő menüt, hogy válassz valami praktikusat. Használhatsz bármilyen általános USB csatlakozót (beleértve azt is, amelyik áramot szolgáltat a számítógépednek), vagy egy hitelkártyát (vagy bármilyen ugyanolyan méretű kártyát). Helyezd az objektumot a képernyőre, majd mozgasd a csúszkát, hogy beállítsd a képet az objektum méretéhez. Amikor megegyeznek, nyomd meg a RETURN gombot (vagy kattints az OK gombra) a folytatáshoz.",
    is: "Loading...",
    id: "Kami akan mengukur ukuran layar ini. Gunakan menu tarik-turun untuk memilih sesuatu yang praktis. Anda dapat menggunakan konektor USB umum (termasuk yang memberikan daya ke komputer Anda) atau kartu kredit (atau kartu dengan ukuran yang sama). Tempatkan objek Anda di atas layar dan geser penggeser untuk menyesuaikan gambar dengan ukuran objek Anda. Ketika mereka cocok, tekan RETURN (atau klik OK) untuk melanjutkan.",
    it: "Misureremo la dimensione di questo schermo. Utilizza il menu a tendina per scegliere qualcosa di pratico. Puoi usare qualsiasi connettore USB comune (incluso quello che fornisce energia al tuo computer) o una carta di credito (o qualsiasi carta delle stesse dimensioni). Posiziona il tuo oggetto sullo schermo e muovi il cursore per regolare l'immagine in modo che corrisponda alle dimensioni del tuo oggetto. Quando corrispondono, premi INVIO (o clicca su OK) per procedere.",
