    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "Zmierzymy rozmiar tego ekranu. Użyj menu rozwijanego, aby wybrać coś wygodnego. Możesz użyć dowolnego powszechnego złącza USB (w tym tego, które dostarcza zasilanie do komputera) lub karty kredytowej (lub dowolnej karty o takim samym rozmiarze). Umieść swój przedmiot na ekranie i przesuń suwak, aby dopasować obraz do rozmiaru twojego przedmiotu. Gdy się dopasują, naciśnij RETURN (lub kliknij OK), aby kontynuować.",
    pt: "Loading...",
    ro: "Vom măsura dimensiunea acestui ecran. Utilizați meniul derulant pentru a alege ceva la îndemână. Puteți utiliza orice conector USB obișnuit (inclusiv cel care furnizează energie computerului dumneavoastră) sau o carte de credit (sau orice carte de aceeași dimensiune). Plasați obiectul pe ecran și mutați cursorul pentru a ajusta imaginea în funcție de dimensiunea obiectului dumneavoastră. Când se potrivește, apăsați RETURN (sau faceți clic pe OK) pentru a continua.",
