    cs: "Loading...",
    da: "Loading...",
    nl: "Dank je. De luidspreker is nu gekalibreerd en je kunt de smartphone (of USB-microfoon) opbergen. BELANGRIJK: RAAD DE VOLUMEBEDIENING NIET AAN totdat het experiment is voltooid. Het veranderen van het volume zal de kalibratie van de luidspreker verstoren en alle resultaten ongeldig maken.",
    "en-UK": "Loading...",
    fi: "Kiitos. Kaiutin on nyt kalibroitu, ja voit laittaa älypuhelimen (tai USB-mikrofonin) pois. TÄRKEÄÄ: ÄLÄ KOSKE ÄÄNENVOIMAKKUUDEN SÄÄTIMIIN ennen kuin koe on valmis. Äänenvoimakkuuden muuttaminen pilaa kaiuttimen kalibroinnin ja mitätöi kaikki tulokset.",
    fr: "Merci. Le haut-parleur est maintenant calibré, et vous pouvez ranger le smartphone (ou le microphone USB). IMPORTANT : NE TOUCHEZ PAS AU CONTRÔLE DU VOLUME jusqu'à ce que l'expérience soit terminée. Modifier le volume compromettra l'étalonnage du haut-parleur et invalidera tous les résultats.",
    de: "Dankeschön. Der Lautsprecher ist nun kalibriert und du kannst das Smartphone (oder das USB-Mikrofon) beiseite legen. WICHTIG: BERÜHRE NICHT DIE LAUTSTÄRKEREGELUNG, bis das Experiment abgeschlossen ist. Eine Änderung der Lautstärke würde die Lautsprecherkalibrierung beeinträchtigen und alle Ergebnisse ungültig machen.",
    el: "Loading...",
