    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "Loading...",
    it: "Grazie. L'altoparlante è ora calibrato e puoi riporre lo smartphone (o il microfono USB). IMPORTANTE: NON TOCCARE IL CONTROLLO DEL VOLUME fino al termine dell'esperimento. Modificare il volume rovinerà la calibrazione dell'altoparlante e invaliderà tutti i risultati.",
    ja: "Loading...",
    kn: "Loading...",
    ko: "감사합니다. 스피커는 이제 보정되었으며, 스마트폰 (또는 USB 마이크)를 정리할 수 있습니다. 중요: 실험이 완료될 때까지 볼륨 조절을 하지 마십시오. 볼륨을 변경하면 스피커 보정이 망가지고 모든 결과가 무효화됩니다.",
    lt: "Ačiū. Garsiakalbis dabar sukalibruotas, ir galite pasidėti atokiau išmanųjį telefoną (arba USB mikrofoną). Svarbu: NELEISKITE LIKĖLIO VALDYMO, kol eksperimentas nebaigtas. Garsio reguliavimo keitimas sugadins garsiakalbio kalibravimą ir panaikins visus rezultatus.",
