    ko: "Loading...",
    lt: "Loading...",
    ms: "Loading...",
    ml: "Loading...",
    no: "Loading...",
    fa: "Loading...",
    pl: "Przesunięcie linii różni się od dużego i łatwego do małego i trudnego. Nie możesz uzyskać więcej niż dwie trzecie poprawnie, więc się zrelaksuj. Traktuj to jako grę w zgadywanie i po prostu zdobądź tyle, ile możesz. Usłyszysz sygnał dźwiękowy, gdy będziesz miał rację.",
    pt: "Loading...",
    ro: "Schimbarea de linie variază de la mare și ușoară până la mică și dificilă. Nu poți obține mai mult de două treimi corect, așa că relaxează-te. Gândește-te la asta ca la un joc de ghicit și încearcă să ghicești cât mai multe. Vei auzi un bip ori de câte ori ai dreptate.",
    ru: "Переход на новую строку может быть как большим и легким, так и маленьким и сложным. Вы не сможете правильно угадать больше двух третей, поэтому расслабьтесь. Думайте об этом как об игре в угадывание и просто старайтесь угадать как можно больше. Вы услышите сигнал, когда будете правы.",
    sr: "Promena linije varira od velike i jednostavne do male i teške. Ne možete postići više od dve trećine tačnosti, zato se opustite. Zamislite to kao igru pogađanja i samo pokušajte da dobijete što više možete. Čućete zvuk beep-a kada ste u pravu.",
    es: "El cambio de línea varía desde grande y fácil hasta pequeño y difícil. No puedes acertar mucho más de dos tercios, así que relájate. Piénsalo como un juego de adivinanzas y simplemente consigue tantos como puedas. Escucharás un pitido cada vez que aciertes.",
    su: "Perubahan baris bervariasi dari besar dan mudah hingga kecil dan sulit. Anda tidak bisa mendapatkan lebih dari dua pertiga benar, jadi santai saja. Pikirkan ini sebagai permainan tebak-tebakan, dan dapatkan sebanyak mungkin. Anda akan mendengar bunyi beep setiap kali Anda benar.",
    sw: "Mabadiliko ya mstari hutofautiana kutoka kubwa na rahisi hadi ndogo na ngumu. Huwezi kupata zaidi ya thuluthi mbili sawa, kwa hivyo tulia. Chukulia kama mchezo wa kubahatisha, na pata kadri unavyoweza. Utasikia sauti ya beep wakati wowote utakapokuwa sahihi.",
