    no: "✋ Dette tastaturet vil bli aktivert når ønsket visningsavstand overstiger 111 cm. Inntil da, bruk datamaskinens tastatur.",
    fa: "✋ این صفحه کلید زمانی فعال می شود که فاصله دید مورد نظر از 111 سانتی متر بیشتر شود. تا آن زمان، از صفحه کلید رایانه خود استفاده کنید.",
    pl: "✋ Ta klawiatura zostanie włączona, gdy żądana odległość oglądania przekroczy 111 cm. Do tego czasu korzystaj z klawiatury komputera.",
    pt: "✋ Este teclado será habilitado quando a distância de visualização desejada exceder 111 cm. Até então, use o teclado do seu computador.",
