    ru: "✋ Эта клавиатура активируется, когда желаемое расстояние просмотра превышает 111 см. А до тех пор используйте клавиатуру вашего компьютера.",
    sr: "✋ Ова тастатура ће бити омогућена када жељена удаљеност гледања пређе 111 цм. До тада користите тастатуру рачунара.",
    es: "Este teclado se activará cuando la distancia de visualización deseada supere los 111 cm. Hasta entonces, utiliza el teclado de tu computadora.",
    su: "✋ Alas kenop ieu bakal diaktipkeun lamun jarak tempoan nu dipikahoyong ngaleuwihan 111 cm. Nepi ka harita, paké kibor komputer.",
    sw: "✋ Kitufe hiki kitawashwa wakati umbali unaotaka wa kutazama unazidi cm 111. Hadi wakati huo, tumia kibodi ya kompyuta yako.",
    sv: "✋ Denna knappsats aktiveras när det önskade visningsavståndet överstiger 111 cm. Tills dess använder du datorns tangentbord.",
    tl: "✋ Ang keypad na ito ay paganahin kapag ang nais na distansya sa pagtingin ay lumampas sa 111 cm. Hanggang sa panahong iyon, gamitin ang keyboard ng iyong computer.",
    tr: "✋ İstenilen izleme mesafesi 111 cm'yi aştığında bu tuş takımı etkinleştirilecektir. O zamana kadar bilgisayarınızın klavyesini kullanın.",
    ur: "✋ یہ کی پیڈ اس وقت فعال ہو جائے گا جب دیکھنے کا مطلوبہ فاصلہ 111 سینٹی میٹر سے زیادہ ہو جائے۔ تب تک، اپنے کمپیوٹر کا کی بورڈ استعمال کریں۔",
