    ru: "Если этот экран завис, подключитесь повторно, наведя камеру смартфона на QR-код на экране компьютера. Когда появится ссылка, коснитесь ее пальцем.",
    sr: "Ако се овај екран замрзне, поново се повежите усмеравањем камере паметног телефона ка КР коду на екрану рачунара. Када се појави веза, додирните је прстом.",
