    su: "Upami layar ieu beku, mangga sambungkeun deui ku arahkeun kaméra smartphone anjeun ka kode QR dina layar komputer anjeun. Lamun link nembongan, toel eta ku ramo Anjeun.",
    sw: "Ikiwa skrini hii itaganda, tafadhali unganisha tena kwa kuelekeza kamera yako mahiri kwenye msimbo wa QR kwenye skrini ya kompyuta yako. Wakati kiungo kinapoonekana, kiguse kwa kidole chako.",
    sv: "Om den här skärmen fryser, vänligen anslut igen genom att rikta din smartphones kamera mot QR-koden på din datorskärm. När en länk visas trycker du på den med fingret.",
    tl: "Kung nag-freeze ang screen na ito, mangyaring kumonekta muli sa pamamagitan ng pagturo ng iyong smartphone camera sa QR code sa screen ng iyong computer. Kapag lumitaw ang isang link, pindutin ito gamit ang iyong daliri.",
    tr: "Bu ekran donarsa lütfen akıllı telefonunuzun kamerasını bilgisayar ekranınızdaki QR koduna doğrultarak yeniden bağlanın. Bir bağlantı göründüğünde parmağınızla ona dokunun.",
    ur: "اگر یہ اسکرین جم جاتی ہے، تو براہ کرم اپنے اسمارٹ فون کیمرہ کو اپنی کمپیوٹر اسکرین پر QR کوڈ کی طرف اشارہ کرکے دوبارہ جڑیں۔ جب کوئی لنک ظاہر ہو تو اسے اپنی انگلی سے چھوئے۔",
