    fr: "C'est un R. Cet affichage est statique, donc il serait facile de déplacer vos yeux vers la lettre et de l'identifier. Mais, dans un vrai essai, les lettres sont CLIGNOTANTES, donc il n'y a pas le temps de déplacer vos yeux. Il est important de regarder la croix lorsque vous démarrez l'essai. Les lettres vont clignoter immédiatement. Peu importe où vos yeux se dirigent après le clignotement. Le premier bloc de tests est juste quelques essais de pratique, avant de commencer sérieusement.",
    de: "Es ist ein R. Dieser Bildschirm ist statisch, daher wäre es einfach, deine Augen auf den Buchstaben zu bewegen und ihn zu identifizieren. Aber in einem echten Versuch werden die Buchstaben BLITZARTIG angezeigt, sodass keine Zeit bleibt, deine Augen zu bewegen. Es ist wichtig, auf das Fadenkreuz zu schauen, wenn du den Versuch startest. Die Buchstaben werden sofort aufblitzen. Es spielt keine Rolle, wohin deine Augen nach dem Blitz gehen. Der erste Block des Tests besteht nur aus ein paar Übungsdurchgängen, bevor wir ernsthaft beginnen.",
