      "On each trial, whilst you look at the cross hairs, a pair of lines will FLASH somewhere. Maybe where you're looking; maybe in the corner of your eye. Just a flash. To learn the task, let’s try it first with a STATIC display. Whilst looking at the cross hairs, below, without moving your eyes: Is the upper line shifted left or right, relative to the lower line?",
    fi: "Jokaisella kokeella, kun katsot ristikkoa, parin viiva VÄLÄHTÄÄ jossain. Ehkä siellä, minne katsot; ehkä silmäkulmassa. Vain välähdys. Oppiaksesi tehtävän, kokeillaan sitä ensin STAATTISELLA näytöllä. Katsoen ristikkoa, alla, liikuttamatta silmiäsi: Onko ylempi viiva siirtynyt vasemmalle vai oikealle suhteessa alempaan viivaan?",
    fr: "À chaque essai, pendant que vous regardez la croix, une paire de lignes va CLIGNOTER quelque part. Peut-être là où vous regardez ; peut-être dans le coin de votre œil. Juste un flash. Pour apprendre la tâche, essayons d'abord avec un affichage STATIQUE. Tout en regardant la croix, ci-dessous, sans bouger vos yeux : La ligne supérieure est-elle décalée vers la gauche ou la droite, par rapport à la ligne inférieure ?",
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "प्रत्येक प्रयास पर, जब आप ध्यान से निशानों को देखते हैं, कहीं एक रेखा की चमक होगी। शायद वहां होगी जहां आप देख रहे हैं; शायद आपकी आंख के कोने में होगी। बस एक चमक। कार्य को सीखने के लिए, आइए इसे पहले स्थिर प्रदर्शन के साथ प्रयास करें। निशानों को देखते हुए, नीचे दिए गए निशानों के संबंध में ऊपरी रेखा बाएं या दाएं में स्थानांतरित है?",
    hu: "Loading...",
    is: "Á hverri reynslu, meðan þú horfir á krosshárin, munu línuhjólin SKÍNA einhvers staðar. Kannski þar sem þú horfir; kannski í útvegum auga þíns. Bara skína. Til að læra verkefnið, skulum við prófa það fyrst með STATIC sýn. Meðan þú horfir á krosshárin hér að neðan, án þess að færa augun þín: Er efra línan færð til vinstri eða hægri, miðað við neðra línu?",
