    tr: "Her denemede, çapraz teli izlerken, bir çift çizgi bir yerde PARLAYACAK. Belki de baktığınız yerde; belki de gözünüzün köşesinde. Sadece bir flaş. Görevi öğrenmek için, önce SABİT bir görüntüyle deneyelim. Çapraz teli izlerken, aşağıdaki gibi gözlerinizi hareket ettirmeden: Üst çizgi alt çizgiye göre sola mı yoksa sağa mı kaydırılmıştır?",
    ur: "Loading...",
