    nl: "Loading...",
    "en-UK": "Loading...",
    fi: "Loading...",
    fr: "C'est un R. Cet affichage est statique, donc il serait facile de déplacer vos yeux vers la lettre et de l'identifier. Mais, dans un essai réel, la lettre est AFFICHÉE brièvement, donc il n'y a pas le temps de déplacer vos yeux. Il est important de regarder la croix lorsque vous démarrez l'essai. La lettre va s'afficher immédiatement. Peu importe où vos yeux se dirigent après l'éclair. Le premier bloc de tests n'est que quelques essais de pratique, avant de commencer sérieusement.",
    de: "Es ist ein R. Dieses Display ist statisch, daher wäre es einfach, deine Augen auf den Buchstaben zu bewegen und ihn zu identifizieren. Aber in einem echten Versuch wird der Buchstabe BLITZARTIG gezeigt, daher bleibt keine Zeit, deine Augen zu bewegen. Es ist wichtig, die Fadenkreuze anzusehen, wenn du den Versuch startest. Der Buchstabe wird sofort blitzartig erscheinen. Es spielt keine Rolle, wohin deine Augen nach dem Blitz gehen. Der erste Testblock besteht nur aus ein paar Übungsversuchen, bevor wir ernsthaft beginnen.",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Ez egy R betű. Ez a kijelző statikus, így könnyű a szemeket a betűre irányítani és azonosítani. Azonban egy valós kísérlet során a betű VILLAN, így nincs idő a szemek mozgatására. Fontos, hogy a kereszt hajszálakat nézze, amikor elindítja a kísérletet. A betű azonnal felvillan. Nem számít, hogy a villanás után hova néznek a szemei. Az első tesztblokk csak néhány gyakorló kísérlet, mielőtt komolyan elkezdünk.",
    is: "Þetta er R. Þessi sýn er kyrrstæð, svo það væri auðvelt að færa augunin til bókstafsins og þekkja hann. En í raunverulegum prófi er bókstafurinn FLASHAÐUR, svo enginn tími er til að færa augunin. Mikilvægt er að horfa á krosshárin þegar þú hefst prófið. Bókstafurinn mun flasa strax. Skiptir engu máli hvar augun þín fara eftir flöshunni. Fyrsta blokk prófsins er bara nokkrar æfingarprófanir, áður en við byrjum alvarlega.",
    id: "Loading...",
    it: "È una R. Questo display è statico, quindi sarebbe facile spostare gli occhi sulla lettera e identificarla. Ma, in un vero esperimento, la lettera viene LAMPEGGIATA, quindi non c'è tempo per muovere gli occhi. È importante fissare la croce mentre si avvia la prova. La lettera lampeggerà immediatamente. Non importa dove vanno i tuoi occhi dopo il lampeggio. Il primo blocco di test è solo qualche prova pratica, prima di iniziare sul serio.",
    ja: "「これはRです。この表示は静止しているので、目を文字に移動させて識別するのは簡単です。しかし、実際の試行では文字がフラッシュされるため、目を移動する時間はありません。試行を開始する際に十字線を見ることが重要です。文字はすぐにフラッシュされます。フラッシュ後に目がどこに行っても問題ありません。最初のテストブロックは真剣に始める前の練習のいくつかの試行です。」",
