    fa: "Loading...",
    pl: "Loading...",
    pt: "É um R. Este display é estático, então seria fácil mover os olhos para a letra e identificá-la. Mas, em um teste real, a letra é FLASHADA, então não há tempo para mover os olhos. É importante olhar para o cruzamento enquanto você inicia o teste. A letra piscará imediatamente. Não importa para onde seus olhos vão após o flash. O primeiro bloco de testes é apenas alguns testes de prática, antes de começarmos a sério.",
    ro: "Este un R. Acest afișaj este static, deci ar fi ușor să-ți miști ochii spre literă și să o identifici. Dar, într-un proces real, litera este FLUTURATĂ, deci nu ai timp să-ți miști ochii. Este important să te uiți la crucea centrală în momentul în care inițiezi procesul. Litera va fi fluturată imediat. Nu contează unde se duc ochii tăi după fluturare. Primul bloc de testare constă doar în câteva încercări de antrenament, înainte să începem serios.",
    ru: "Loading...",
    sr: "Loading...",
    es: "Es una R. Esta pantalla es estática, por lo que sería fácil mover tus ojos hacia la letra e identificarla. Pero, en un ensayo real, la letra se MUESTRA RÁPIDAMENTE, así que no hay tiempo para mover los ojos. Es importante mirar la cruz mientras inicias el ensayo. La letra aparecerá de inmediato. No importa hacia dónde vayan tus ojos después del destello. El primer bloque de pruebas es solo unas pocas pruebas de práctica, antes de comenzar en serio.",
    su: "Loading...",
    sw: "Loading...",
    sv: "Det är ett R. Den här skärmen är statisk, så det skulle vara lätt att flytta dina ögon till bokstaven och identifiera den. Men, i en verklig testning, blinkar bokstaven, så det finns ingen tid att flytta dina ögon. Det är viktigt att titta på korsmarkeringen när du startar testningen. Bokstaven kommer att blinka omedelbart. Det spelar ingen roll var dina ögon går efter blixten. Den första testningsblocket är bara några övningstest, innan vi börjar på allvar.",
    tl: "Loading...",
    tr: "Loading...",
    ur: "یہ ایک آر ہے۔ یہ ڈسپلے ساکن ہے، لہذا حرف کو دیکھنے اور شناخت کرنے کے لئے آپ کی آنکھوں کو آسانی سے حرکت کرنا ممکن ہوگا۔ لیکن، ایک حقیقی مقدمے میں، حرف فلیش کیا جاتا ہے، لہذا آپ کی آنکھوں کو حرکت کرنے کا وقت نہیں ہوتا۔ مقدمے کو آغاز کرتے ہوئے کراس ہیئرز پر نظر رکھنا اہم ہے۔ حرف فوراً فلیش ہوگا۔ فلیش کے بعد آپ کی آنکھوں کا رخ کہاں بھی ہو، اس کا کوئی اہمیت نہیں ہوتی۔ ٹیسٹنگ کا پہلا بلاک صرف کچھ مشق کے مقدمات ہیں، جب ہم اصل میں شروع کرتے ہیں۔",
